import { Button } from "@mui/material";
import LogoutTwoToneIcon from "@mui/icons-material/LogoutTwoTone";
import React, { useEffect } from "react";
import { Link, useNavigate } from "react-router-dom";
import "../Css/Home.css";

const Home = () => {
  const navigate = useNavigate();
  useEffect(() => {
    if (localStorage.getItem("token") == null) navigate("/");
  }, []);
  return (
    <div className="container">
      <div className="card-container">
        <div className="top-section">
          <div className="head-title">Home</div>
          <div className="logout">
            <Button
              variant="outlined"
              startIcon={<LogoutTwoToneIcon />}
              onClick={() => {
                localStorage.removeItem("token");
                navigate("/");
              }}
            >
              Logout
            </Button>
          </div>
        </div>
        <Link to="/add_gsm" className="card">
          <div className="card-content">Add GSM</div>
        </Link>
        <Link to="/add_shade" className="card">
          <div className="card-content">Add Shade</div>
        </Link>
        <Link to="/add_high_defects" className="card">
          <div className="card-content">Add No Of High Defects</div>
        </Link>
        <Link to="/pass_fail_status" className="card">
          <div className="card-content">Pass Fail Status</div>
        </Link>
        <Link to="/configuration" className="card">
          <div className="card-content">Configuration</div>
        </Link>
        <Link to="/reports" className="card">
          <div className="card-content">Reports</div>
        </Link>
      </div>
    </div>
  );
};

export default Home;
